import Sidebar from '../components/Sidebar';
import Layout from '../components/Layout';
export default () => (
	<Layout>
		<div
			className="flex bg-white pl-4 border-b-2 border-gray-300 items-stretch"
			style={{
				height: '4.51rem',
				boxShadow: 'inset 12px 4px 4px 0 rgba(0, 0, 0, 0.03)',
			}}
		>
			<div className="self-center">
				<img className="h-8 w-8" src="./assets/icons/search.svg" alt="" />{' '}
			</div>
		</div>
	</Layout>
);
